import React from "react";
import SocialMedia from "../../common/SocialMedia";
import {
  Avatar,
  Button,
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";
import { Box } from "@mui/system";

const styles = {
  relativeCardStyle: {
    position: "relative",
    background:
      "linear-gradient(0deg, rgba(255,253,249,1) 63%, rgba(34,193,195,1) 47%)",
  },
  formBoxStyle: {
    position: "absolute",
    top: "30%",
    left: "50%",
    transform: "translate(-50%, -30%)",
    bgcolor: "background.paper",
    boxShadow: "24",
    p: 4,
    backgroundColor: "rgba(255, 255, 255)",
    backdropFilter: "blur(5px)",
  },
};
const LabelCard = ({ label }) => {
  return (
    <Card
      sx={{ maxWidth: 300, height: "250px" }}
      style={styles.relativeCardStyle}
    >
      <Typography height="100px">{label.name}</Typography>
      <Box style={styles.formBoxStyle}>
        <Avatar sx={{ m: "auto", width: 80, height: 80 }}>Avatar</Avatar>
      </Box>
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Owner : {label.owner}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Founded Year : {label.foundedYear}
        </Typography>
      </CardContent>
      <CardActions sx={{ background: "black" }}>
        <Box
          sx={{
            display: "flex",
            justifyContent: "space-evenly",
            width: "100%",
          }}
        >
          {label.sociallinks.map((socialaccount, i) => (
            <SocialMedia
              socialaccount={socialaccount}
              i={i}
              size={2}
            ></SocialMedia>
          ))}
        </Box>
      </CardActions>
    </Card>
  );
};

export default LabelCard;
